import React from 'react';
import { useNavigate } from 'react-router-dom';

function AdminProfile() {
  const user = JSON.parse(localStorage.getItem("user"));
  const navigate = useNavigate();

  return (
    <div className="main-content">
      <h1>{user.username}'s Profile</h1>
      <div className="profile-card">
        <p><strong>Name</strong><br />{user.username}</p>
        <p><strong>Admin ID</strong><br />#{user.id}</p>
        <p><strong>Email</strong><br />{user.email}</p>
        <button onClick={() => navigate("/stats")}>Check monthly Statistics</button>
        <button onClick={() => navigate("/inventory")}>Request snack Orders</button>
        <button onClick={() => navigate("/dashboard")}>Check Employee History</button>
      </div>
    </div>
  );
}

export default AdminProfile;
